import React, { Component } from 'react';
import filePic from "./file.svg";
import { Container, Row, Col } from 'reactstrap';
import { MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavItem, MDBNavLink, MDBNavbarToggler, MDBCollapse, MDBDropdown,
  MDBDropdownToggle, MDBDropdownMenu, MDBDropdownItem, MDBIcon } from "mdbreact";
import menuPic from "./menu.svg";

class File extends Component {
  state = {
    isOpen: false,modal: false

  };  

toggle = () => {
  this.setState({
    modal: !this.state.modal
  });
}

toggleCollapse = () => {
  this.setState({ isOpen: !this.state.isOpen });
}


  render() {
      return (
        <div className="element" >
          <Row>
          <MDBNavItem >
              <MDBDropdown >
                <MDBDropdownToggle nav caret>
                  <MDBnIco icon="user" /> 

                </MDBDropdownToggle>
                <MDBDropdownMenu className="dropdown-default SubMenu">
                  <MDBDropdownItem  href="#!">Editar Perfil</MDBDropdownItem>
                  <MDBDropdownItem href="#!">Cerrar</MDBDropdownItem>
                </MDBDropdownMenu>
              </MDBDropdown>
            </MDBNavItem>
            <img className="menuPic"  src={menuPic} width="25px" alt="Folder"></img>
          </Row>
          <div className="clickeable">
            <Row>
              <img className="fileIcon" src={filePic} width="80px" alt="File"></img>
            </Row>
            <Row >
              <p className="textElement" width="60px">{this.props.labelFile}</p>
            </Row>
          </div>
        </div>
      );
    }
  }

  export default File;
